/** @jsxImportSource @emotion/react */
import styled from '@emotion/styled'
import Nav from "../components/Nav";
import React from 'react';

const HomeDiv = styled.div`
  background-color: black;
  font-size: 24px;
  border-radius: 4px;
  color: white;
  font-weight: bold;
`

function Home() {
    return(
      <HomeDiv>
        <Nav></Nav>
      </HomeDiv>
    )
}

export default Home;
